import './friends.css'

function Friends({u}) {
    const public_folder=process.env.REACT_APP_PUBLIC_FOLDER
    return (
        <li className="leftbarFriend">
                <img src={public_folder+u.profilePicture} alt="friend profile pic" className="leftbarFriendImg" />
                <span className="leftbarFriendName">{u.username}</span>
        </li>
    )
}

export default Friends
